import { v4 as uuidv4 } from 'uuid';
import { toDo, inProgress, done } from '../redux/issues';
import { useDispatch } from 'react-redux';
import { useAppSelector } from '../redux/hooks';

import React from 'react'

export const GetIssues = async (repoUrl: string) => {
  const dispatch = useDispatch();
  const openState = useAppSelector((state) => state.issues.toDo)
  const openAsigneeState = useAppSelector((state) => state.issues.inProgress)
  const closedState = useAppSelector((state) => state.issues.done)
  const urlParts = repoUrl.split('/');
  const owner = urlParts[3];
  const repo = urlParts[4];
  const response = await fetch(`https://api.github.com/repos/${owner}/${repo}/issues?state=all`);
  const issues = await response.json();
  dispatch(toDo([issues.filter((item:any) => item.state === "open" && !!!item.assignee)]))
  dispatch(inProgress([issues.filter((item:any) => item.state === "open" && !!item.assignee === true)]))
  dispatch(done([issues.filter((item:any) => item.state === "closed")]))
  console.log(openState)
  console.log(openAsigneeState)
  console.log(closedState)
  return issues;
}

